    return (
        <div>
            <h1 className = "text-center"> Courses List</h1>
            <table className = "table table-striped">
                <thead>
                    <tr>
                        <td> Course Id</td>
                        <td> Course courseName</td>
                        <td> Course department</td>
                        <td> Course prerequisite</td>
                    </tr>

                </thead>
                <tbody>
                    {
                        resultCourses.map(
                            course => 
                            <tr key = {course.id}>
                                 <td> {course.id}</td>   
                                 <td> {course.courseName}</td>   
                                 <td> {course.department}</td>   
                                 <td> {course.prerequisite}</td>   
                            </tr>
                        )
                    }
                </tbody>
            </table>
        </div>
    )


